import React, { memo } from 'react'

const Vhes = memo((props) => {
    return (
        <>
            {props.data.map((vhe, index) => (
                <div>
                    <div>{vhe.data.vheId}</div>
                    <div>{vhe.data.vheName}</div>
                </div>
            ))}
        </>
    )
})

export default Vhes
